def fibonacci(n):
    a = 1
    b = 1
    fib_series = []
    while a <= n:
        fib_series.append(a)
        (a, b) = (b, a + b)
    return fib_series

def entance(my_set):
    copied_set = my_set.copy()
    results = {}
    for i in copied_set:
        if i % 2 == 0:
            results[i] = math.factorial(i)
        else:
            results[i] = fibonacci(i)
    return (copied_set, results)

